import Logo from "../assets/logo.png";
import Navfooter from "../components/navfooter";

const Footer = () => {
  return (
    <div className="Footer">
      <div className="iconesfooter">
        <div className="boxfooter">
          <img src="https://i.goopics.net/5af8wi.png" className="iconef" />
          <p>A domicile</p>
        </div>
        <div className="boxfooter">
          <img src="https://i.goopics.net/n7xqm1.png" className="iconef" />
          <p>Produits Bios & naturel</p>
        </div>
        <div className="boxfooter">
          <img src="https://i.goopics.net/krhrfe.png" className="iconef" />
          <p>Masseuse Bilingue</p>
        </div>
      </div>
      <div class="imgfooter"></div>

    </div>
  );
};

export default Footer;
